async def test_image_to_text():
    """Тест решения обычной капчи-картинки"""
    print("\n=== TEST: Image to Text ===")

    m = CaptchaManager()
    # Настройка параметров
    m.set_polling(poll_interval=3.0, status_timeout=120.0)
    m.set_retry(max_retries=2)

    # Пример base64 изображения (замените на свой)
    image_base64 = ""

    result = await m.atni_captcha.image_to_text(
        client_key="2c6419f4539df59baf6cfacc9a2f4b3c",
        body_base64=image_base64,
        phrase=False,        # капча содержит 2-3 слова
        case=True,           # регистрозависимая
        numeric=0,           # 0=любые символы, 1=только цифры, 2=без цифр
        math=False,          # математическая операция (например: 2+3=?)
    )

    print(f"Status: {result.status}")
    print(f"Task ID: {result.task_id}")
    print(f"Solution: {result.solution}")
    print(f"Attempts: {result.attempts}")
    if result.errors:
        print(f"Errors: {result.errors}")


