async def test_with_settings():
    """Пример с настройкой всех параметров"""
    print("\n=== TEST: With Custom Settings ===")

    m = CaptchaManager()

    # Настройка polling
    m.set_polling(
        poll_interval=2.5,  # интервал между запросами статуса
        status_timeout=150.0  # общий таймаут ожидания
    )

    # Настройка retry
    m.set_retry(
        max_retries=3,  # количество повторов при сетевых ошибках
        retry_interval=1.5,  # пауза между повторами
        backoff_factor=2.0  # множитель задержки
    )

    # Настройка request
    m.set_request(
        request_timeout=45.0,  # таймаут каждого HTTP-запроса
        verify_ssl=True,  # проверка SSL
        proxy=None  # прокси для запросов к API (не для решения капчи!)
    )

    result = await m.anticaptcha.turnstile_proxyless(
        client_key="YOUR_API_KEY",
        website_url="https://example.com",
        website_key="0x4AAAAAAAChNiVJM_WtShFf",
    )

    print(f"Status: {result.status}")
    print(f"Solution: {result.solution}")


